import {BrowserRouter, Route } from 'react-router-dom';
import './App.css';

//Components
import Login from './Components/Login';


function App() {
  return (
     <BrowserRouter>
      <div className="App">
        <Route path="/login" exact>
          <Login/>
        </Route>
      </div>
     </BrowserRouter>
  );
}

export default App;
